    "2016-07-27T22:42:13.816615",nt"name": "organochlorine-chemical-hazards-for-sturgeon-larvae-in-the-middle-mississippi-river-nation",nt"isopen":
    false,nt"url": null,nt"notes": "We conducted an ecological risk assessment
    to characterize organochlorine chemical hazards for sturgeon larvae in the Middle
    Mississippi River National Wildlife Refuge, Illinois and Missouri. The risk assessment
    results indicated that the concentrations of chlordane in shovelnose sturgeon eggs
    collected from the Middle Mississippi River were less than experimentally derived
    toxicity effects thresholds for shovelnose sturgeon eggs except for one occasion.
    The occurrence was during the mid-1990u2019s at a location near Chester, Illinois.
    Most of the total PCB concentrations in sturgeon eggs collected from the Middle
    Mississippi River were greater than toxicity effects thresholds for warm water fish
    species published in the scientific literature, but when converted to dioxin equivalent
    values they were less than sturgeon specific toxicity effects thresholds. The federally
    listed endangered pallid sturgeon has the potential to accumulate chlordane and
    PCBs along with other organochlorine chemicals at concentrations of sufficient magnitude
    to reduce survival of their young because of the species trophic level and the species
    longevity.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
